import React from 'react';
import Login from "./components/login";

function App() {
  return (
  <div>
    <BrowserRouter>
    <div>
   <Route exact path='/' component={Login} />
    </div>
  </BrowserRouter>

    <div className="App">
      <Login />
    </div>
    </div>
  );
}

export default App;
